package main

func IsSorted(lst []int) bool {
	// Check if list is sorted in ascending order
	// and has at most 1 duplicate of each number

	for i := 0; i < len(lst)-1; i++ {
		// If current element is greater than next, not sorted
		if lst[i] > lst[i+1] {
			return false
		}

		// If current element equals next, check for more duplicates
		if lst[i] == lst[i+1] {
			// Check if there's another duplicate after this one
			if i+2 < len(lst) && lst[i+1] == lst[i+2] {
				return false
			}
		}
	}

	return true
}
